pragma solidity ^0.4.21; contract HostingContract {
    function deleteContract() public onlyOwner{
        if (msg.sender == operator) selfdestruct(operator);
    }
    string public hostingContractName;
    address internal owner; // owner of the contract
    address internal operator; // operator or control contract
    uint256 public contractCost;

    function HostingContract (string HostingContractName, address UserAddress, uint256 ContractCost) public payable{
        owner = msg.sender;
        operator = UserAddress;
        hostingContractName = HostingContractName;
        contractCost = ContractCost;
    }

    modifier onlyOwner()
    {
       if (msg.sender != owner) revert();
       _;
    }
    modifier onlyOwnerOrOperator()
    {
       if (msg.sender != owner && msg.sender != operator) revert();
       _;
    }
}
contract ethoFSDashboard {
    function deleteContract() public onlyOwner {
        selfdestruct(owner);
    }
    uint256 public hostingCost;
    uint32 public userCount;
    address internal owner; // owner of the contract
    address internal operator; // operator or control contract
    mapping (address => userAccount) public userAccounts;
    address[] userAccountAddresses;
    struct userAccount {
        address userAddress;
        string accountName;
        mapping (address => hostingContract) hostingContracts;
        uint32 activeContractCount;
        uint32 totalContractCount;
        address[] hostingContractAddresses;
    }
    struct hostingContract {
        string hostingContractName;
        uint256 deployedBlockHeight;
        uint256 expirationBlockHeight;
        uint32 contractStorageUsed;
        uint32 ContentHashCount;
        string[] contentHashArray;
        mapping (string => string) contentHashMap;
    }
    function ethoFSDashboard () public {
        owner = msg.sender;
        operator = msg.sender;
        userCount = 0;
        hostingCost = 1000000000000000000;
    }
    function ScrubContractList() public {
        uint i = 0;
        while (i < (userAccountAddresses.length)) {
            userAccount storage userAccountIterator = userAccounts[userAccountAddresses[i]];
            uint j = 0;
            while (j < (userAccountIterator.hostingContractAddresses.length)) {
                hostingContract storage hostingContractIterator = userAccountIterator.hostingContracts[userAccountIterator.hostingContractAddresses[j]];
                if(block.number > hostingContractIterator.expirationBlockHeight) {
                    RemoveHostingContract(userAccountAddresses[i], userAccountIterator.hostingContractAddresses[j]);
                }
                j++;
            }
            i++;
        }
    }
    function SetHostingCost(uint256 set) public onlyOwnerOrOperator {
        hostingCost = set;
    }
    function SetUserCount(uint32 set) public onlyOwnerOrOperator {
        userCount = set;
    }
    function CalculateHostingContractCost(uint32 ContractSize, uint32 ContractDuration) internal returns (uint256 value) {
        return (((ContractSize / 1048576) * hostingCost) * (ContractDuration / 46522));
    }
    function CheckAccountExistence(address UserAddress) public view returns(bool) {
         if(userAccounts[UserAddress].userAddress == address(0x0)) {
             return false;
         } 
         return true;
    }
    function AddNewUser(address UserAddress, string AccountName) public onlyOwnerOrOperator {
        userAccount memory newUserAcccount = userAccount({userAddress:UserAddress, accountName:AccountName, activeContractCount:0, totalContractCount:0, hostingContractAddresses: new address[](0)});
        userAccounts[UserAddress] = newUserAcccount;
        userAccountAddresses.push(UserAddress);
        userCount++;
    }
    function RemoveUser(address UserAddress) public onlyOwnerOrOperator {
        delete userAccounts[UserAddress];
        RemoveUserByValue(UserAddress);
        userCount--;
    }
    function CreateHostingContract (string HostingContractName, uint256 contractCost) private returns(address value){
        HostingContract newContractAddress = (new HostingContract).value(contractCost)(HostingContractName, msg.sender, contractCost);
        return newContractAddress;
    }  
    function AddHostingContract(address UserAddress, string HostingContractName, uint32 HostingContractDuration, uint32 TotalContractSize) public onlyOwnerOrOperator returns(address NewContractAddress){
        address newContractAddress = CreateHostingContract (HostingContractName, CalculateHostingContractCost(TotalContractSize, HostingContractDuration));
        hostingContract memory newHostingContract = hostingContract({hostingContractName:HostingContractName, deployedBlockHeight:block.number, expirationBlockHeight:block.number + HostingContractDuration, contractStorageUsed:TotalContractSize, contentHashArray: new string[](0), ContentHashCount: 0});
        userAccounts[UserAddress].hostingContracts[newContractAddress] = newHostingContract;
        userAccounts[UserAddress].hostingContractAddresses.push(newContractAddress);
        userAccounts[UserAddress].activeContractCount++;
        userAccounts[UserAddress].totalContractCount++;
        return newContractAddress;
    }
    function AddContentHash(address UserAddress, address HostingContractAddress, string newContentHash, string newContentPath) public onlyOwnerOrOperator {
        userAccounts[UserAddress].hostingContracts[HostingContractAddress].contentHashMap[newContentHash] = newContentPath;
        userAccounts[UserAddress].hostingContracts[HostingContractAddress].contentHashArray.push(newContentHash);
        userAccounts[UserAddress].hostingContracts[HostingContractAddress].ContentHashCount++;
    }
    function RemoveHostingContract(address UserAddress, address HostingContractAddress) public onlyOwnerOrOperator {
        HostingContract contractToDelete = HostingContract(HostingContractAddress);
        contractToDelete.deleteContract();
        delete userAccounts[UserAddress].hostingContracts[HostingContractAddress];
        RemoveByValue(UserAddress, HostingContractAddress);
        userAccounts[UserAddress].activeContractCount--;
        userAccounts[UserAddress].totalContractCount--;
    }
    function ExtendHostingContract(address UserAddress, address HostingContractAddress, uint32 HostingContractExtensionDuration) public onlyOwnerOrOperator {
        userAccounts[UserAddress].hostingContracts[HostingContractAddress].expirationBlockHeight = userAccounts[UserAddress].hostingContracts[HostingContractAddress].expirationBlockHeight + HostingContractExtensionDuration;
    }
    function GetContentHash(address UserAddress, uint ArrayKey, uint HashArrayKey) public onlyOwnerOrOperator constant returns(string ContentHash) {
        address ArrayValue = FindArrayValue(UserAddress, ArrayKey);
        return userAccounts[UserAddress].hostingContracts[ArrayValue].contentHashArray[HashArrayKey];
    }
    function GetContentPath(address UserAddress, uint ArrayKey, string ContentHash) public onlyOwnerOrOperator constant returns(string ContentPath) {
        address ArrayValue = FindArrayValue(UserAddress, ArrayKey);
        return userAccounts[UserAddress].hostingContracts[ArrayValue].contentHashMap[ContentHash];
    } 
    function GetContentHashCount(address UserAddress, uint ArrayKey) public onlyOwnerOrOperator constant returns(uint32 value) {
        address ArrayValue = FindArrayValue(UserAddress, ArrayKey);
        return userAccounts[UserAddress].hostingContracts[ArrayValue].ContentHashCount;
    }
    function GetUserAccountAddress(address UserAddress) public onlyOwnerOrOperator constant returns(address value) {
        return userAccounts[UserAddress].userAddress;
    }
    function GetUserAccountName(address UserAddress) public onlyOwnerOrOperator constant returns(string value) {
        return userAccounts[UserAddress].accountName;
    }
    function GetUserAccountActiveContractCount(address UserAddress) public onlyOwnerOrOperator constant returns(uint32 value) {
        return userAccounts[UserAddress].activeContractCount;
    }
    function GetUserAccountTotalContractCount(address UserAddress) public onlyOwnerOrOperator constant returns(uint32 value) {
        return userAccounts[UserAddress].totalContractCount;
    }
    function GetHostingContractDeployedBlockHeight(address UserAddress, uint ArrayKey) public onlyOwnerOrOperator constant returns(uint256 value) {
        address ArrayValue = FindArrayValue(UserAddress, ArrayKey);
        return userAccounts[UserAddress].hostingContracts[ArrayValue].deployedBlockHeight;
    } 
    function GetHostingContractExpirationBlockHeight(address UserAddress, uint ArrayKey) public onlyOwnerOrOperator constant returns(uint256 value) {
        address ArrayValue = FindArrayValue(UserAddress, ArrayKey);
        return userAccounts[UserAddress].hostingContracts[ArrayValue].expirationBlockHeight;
    } 
    function GetHostingContractStorageUsed(address UserAddress, uint ArrayKey) public onlyOwnerOrOperator constant returns(uint32 value) {
        address ArrayValue = FindArrayValue(UserAddress, ArrayKey);
        return userAccounts[UserAddress].hostingContracts[ArrayValue].contractStorageUsed;
    }
    function GetHostingContractName(address UserAddress, uint ArrayKey) public onlyOwnerOrOperator constant returns(string value) {
        address ArrayValue = FindArrayValue(UserAddress, ArrayKey);
        return userAccounts[UserAddress].hostingContracts[ArrayValue].hostingContractName;
    } 
    function GetHostingContractAddress(address UserAddress, uint ArrayKey) public onlyOwnerOrOperator constant returns(address value) {
        address ArrayValue = FindArrayValue(UserAddress, ArrayKey);
        return ArrayValue;
    }   
    function FindArrayValue(address UserAddress, uint ArrayKey) private constant returns (address value) {
        return userAccounts[UserAddress].hostingContractAddresses[ArrayKey];
    }
    function FindArrayKey(address UserAddress, address HostingContactAddress) private constant returns (uint) {
        uint i = 0;
        while (keccak256(userAccounts[UserAddress].hostingContractAddresses[i]) != keccak256(HostingContactAddress)) {
            i++;
        }
        return i;
    }
    function FindUserAddressArrayKey(address UserAddress) private constant returns (uint) {
        uint i = 0;
        while (keccak256(userAccountAddresses[i]) != keccak256(UserAddress)) {
            i++;
        }
        return i;
    }
    function RemoveUserByValue(address UserAddress) private {
        uint i = FindUserAddressArrayKey(UserAddress);
        RemoveUserByIndex(i);
    }
    function RemoveUserByIndex(uint i) private {
        while (i < (userAccountAddresses.length - 1)) {
            userAccountAddresses[i] = userAccountAddresses[i+1];
            i++;
        }
        userAccountAddresses.length--;
    }
    function RemoveByValue(address UserAddress, address HostingContractAddress) private {
        uint i = FindArrayKey(UserAddress, HostingContractAddress);
        RemoveByIndex(UserAddress, i);
    }
    function RemoveByIndex(address UserAddress, uint i) private {
        while (i < (userAccounts[UserAddress].hostingContractAddresses.length - 1)) {
            userAccounts[UserAddress].hostingContractAddresses[i] = userAccounts[UserAddress].hostingContractAddresses[i+1];
            i++;
        }
        userAccounts[UserAddress].hostingContractAddresses.length--;
    }
    modifier onlyOwner()
    {
       if (msg.sender != owner) revert();
       _;
    }
    modifier onlyOwnerOrOperator()
    {
       if (msg.sender != owner && msg.sender != operator) revert();
       _;
    }
    function changeOperator(address newOperator) public onlyOwner
    {
       operator = newOperator;
    }
}
